import React from "react";
import {
  Card,
  CardBody,
  CardFooter,
  CardImg,
  CardSubtitle,
  CardText,
  CardTitle,
  Button,
} from "reactstrap";

const BlogCard = (props) => {
  return (
    <div style={{ "overflow-y": "scroll", "height": "500px","width" : "500px" }}>
    <React.Fragment >
      <Card>
        <CardTitle><h2>{props.title}</h2></CardTitle>
        <CardSubtitle><h3>{props.subtitle}</h3></CardSubtitle>
        <CardImg top width="20%" height="10%" src={props.media} />
        <CardBody>
          <CardText>{props.description}</CardText>
        </CardBody>
        <CardFooter>
          <Button color="info" size="sm">
            Like
          </Button>
          <Button color="info" size="sm">
            Comment
          </Button>
        </CardFooter>
      </Card>
    </React.Fragment>
    </div>
  );
};

export default BlogCard;
